// ==UserScript==
// @name          Upwork: Infinite Scroll, Applicants Count
// @namespace     samete
// @description   Infinite scroll for job feed. Scroll up and scroll donw buttons. Reveal real number of applicants for a job.
// @grant         none
// @include       /^https?://www\.upwork\.com/.*$/
// @require       https://code.jquery.com/jquery-2.2.4.min.js
// @author        Sergey Gulesku
// @version 0.0.1.20161026195722
// ==/UserScript==

if (window!=window.top) { /* I'm in a frame! */
    return;
}


var upImg = backgroundImage = "url('data:image/png;base64,')";


$(document).ready(function(){

  
  var bAnchor = document.createElement('span');
  bAnchor.id = 'isBottom';
  bAnchor.style.display = "block";
  bAnchor.style.height = '1px';
  document.body.appendChild(bAnchor);

  var css = '.revealable {opacity: .4} .revealable:hover {opacity: 1;} #to-bottom-btn { -ms-transform: rotate(180deg);-webkit-transform: rotate(180deg);transform: rotate(180deg);}';
  style = document.createElement('style');
  if (style.styleSheet) {
      style.styleSheet.cssText = css;
  } else {
      style.appendChild(document.createTextNode(css));
  }
  document.getElementsByTagName('head')[0].appendChild(style);


  $('<a />').css('position', 'fixed')
            .css('right', '20px')
            .css('bottom', '20px')
            .css('width', '40px')
            .css('height', '40px')
            .css('z-index', 99999)
            .css('display', 'block')
            .css('background-image', upImg)
            .css('background-size', 'cover')
            .css('outline', 'none')
            .attr('id', 'to-top-btn')
            .attr('href', '#')
            .addClass('revealable')
            .click(function(e){
                e.preventDefault();

                 $('html, body').animate({
                    scrollTop: 0
                }, 500);
            })
            .appendTo(document.body);


  $('<a />').css('position', 'fixed')
            .css('right', '60px')
            .css('bottom', '20px')
            .css('width', '40px')
            .css('height', '40px')
            .css('z-index', 99999)
            .css('display', 'block')
            .css('background-image', upImg)
            .css('background-size', 'cover')
            .css('outline', 'none')
            .attr('id', 'to-bottom-btn')
            .attr('href', '#')
            .addClass('revealable')
            .click(function(e){
                e.preventDefault();
                $('html, body').animate({
                    scrollTop: $( bAnchor ).offset().top
                }, 500);

            })
            .appendTo(document.body);



  var loadMore = document.getElementById('load-more-button');
  if (loadMore) {
    $(document).on('scroll', function(){
      if($(window).scrollTop() + $(window).height() == $(document).height()) {
        loadMore.click();
      }
    });  
  }

  
  var proposals = document.querySelector('[data-ng-init*=applicantsCount]');
  if (proposals) {
    var pCount = proposals.dataset.ngInit.match(/\d+/);
    if (pCount) {
      pCount = pCount[0];
      
      var span = document.createElement('span');
      span.innerText = " " + pCount;
      span.style.fontSize = "2em";
      span.style.color = "black";
      proposals.appendChild(span);
    }
  }
 
});  
